webpackJsonp([0x9a0c874ffd13],{834:function(e,a){e.exports={data:{markdownRemark:{html:'<blockquote>\n<p>──幻想郷は、一人の少女が見ている夢の世界だった。\n少女は夢の中で“霊夢”として幻想郷という世界を治めていたが、夢には必ず終劇がある。\nこの物語は幻想郷が消えた後の物語。</p>\n<p>妖怪たちの奇跡で、魔理沙としての夢を見た普通の女子高生“澪音”。\n一度は忘れた郷を求め、学校生活、私生活の様々なハプニング、そして出会いを乗り越え、やがて彼女は夢の主の少女に“再会”することとなる──</p>\n</blockquote>\n<p>拙作「<a href="../c/concealed-the-conclusion.md">東方夢終劇 Concealed the Conclusion</a>」のスピンオフ物語です。\n幻想郷が消えた後の現実世界を舞台とした、全112ページの半分東方、半分オリジナルなライトノベル。</p>\n<p><a href="https://bookwalker.jp/debe42447a-e129-415a-8d46-a6873232200b/">BOOK☆WALKER でダウンロード頒布中です</a>！<br>\nまた、併せてコミックマーケットでも文庫版を頒布しています。</p>\n<p>イラスト: <a href="http://pixiv.me/mutsuki_nozomi">むつき灯路</a></p>',frontmatter:{cover:null,date:"2016-12-28T00:14:40+09:00",strDate:"2016/12/27",redirect:null,tags:["novel","touhou"],title:"Answer the Conclusion",youtube:"NmR9EevRMJc"}},site:{siteMetadata:{langKeyDefault:"ja",langs:["ja","en"]}}},pathContext:{path:"/ja/p/a/answer-the-conclusion/",langKey:"ja"}}}});
